import './styling/App.css';
import {Link, Route, Routes } from "react-router-dom";
import "bootswatch/dist/minty/bootstrap.min.css"
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';

function App() {




  return (
    <div className="App">


      {['sm'].map((expand) => (
              <Navbar key={expand} expand={expand} className="mb-3">
                <Container fluid>
                  <Navbar.Brand className="title" href="#" variant="light">Tiffany Codes</Navbar.Brand>
                  <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
                  <Navbar.Offcanvas
                    id={`offcanvasNavbar-expand-${expand}`}
                    aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
                    placement="end"
                  >
                    <Offcanvas.Header closeButton>
                      <Offcanvas.Title className="title" id={`offcanvasNavbarLabel-expand-${expand}`}>
                        Tiffany Codes
                      </Offcanvas.Title>
                    </Offcanvas.Header>
                    <Offcanvas.Body>
                      <Nav className="justify-content-end flex-grow-1 pe-3">
                        <Nav.Link className="nav-links" href="#action1">About</Nav.Link>
                        <Nav.Link className="nav-links" href="#action2">Projects</Nav.Link>
                        <Nav.Link className="nav-links" href="#action2">Contact</Nav.Link>
                        <Nav.Link className="nav-links" href="#action2">Resum√©</Nav.Link>
                      </Nav>

                    </Offcanvas.Body>
                  </Navbar.Offcanvas>
                </Container>
              </Navbar>


        ))}



    </div>
  );
}

export default App;
